import $ from 'jquery';
const URL = process.env.REACT_APP_LOCAL;

var divStyle = {
  cursor:'pointer',
};

class Paymentdetail extends React.Component{

  constructor(props){
    super(props);
    this.state = {
      myAddress : [],
      subTotal : 0,
      total:0,
      totalProduct:0,
      checkAddress:0,
    }
  }

  componentWillMount(){
    this.fetchMyAddress();
    setInterval(this.timer, 1000);
  }

  timer() {
    alert('sssss')
  }

